import React, { Component } from 'react';
import Axios from 'axios';

export default class App extends Component {
    constructor(){
        super();
        this.state = {
            indexData: []
        }
    }

    componentDidMount() {
        this.selectDefault();
    }


    selectDefault = async () => {
        try {
            const value = await Axios.get('http://localhost:8080/');
            this.setState({indexData:value.data});

        } catch (err) {
            console.log(err);
        }
    }
    render() {
        return (
            <div>Hello There !</div>
        );
    }
}
